import React, { Component } from 'react';
import { View, StyleSheet, Animated, Image, TextInput } from 'react-native';
import { Feather, Entypo } from '@expo/vector-icons';

export default function Search() {
    return (
        <View style={styles.container}>
            {/* search Icon */}
            <Feather
                name="search"
                size={20}
                color="white"
                style={{ marginLeft: 1 }}
            />
            {/* Input field */}

            <TextInput
                style={styles.input}
                placeholder="Search"
            />

            <Feather
                name="mic"
                size={20}
                color="white"
                style={{ marginLeft: 1 }}
            />
        </View>
      
    )
}

// styles
const styles = StyleSheet.create({
  container: {
    justifyContent: "flex-start",
    alignItems: "center",
    flexDirection: "row",
    backgroundColor: 'rgba(255,255,255,0.1)',
    height: 54,
    borderRadius: 12,
    padding: 20,
  },
 
  input: {
    fontSize: 20,
    marginLeft: 10,
  },
});
